insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('17', '1', 'Bilstein-Street Stock Shock GM Front', 'Bilstein AK 1043 Shock, mono-tube gas pressure shock, IMCA approved. Bilstein shocks will not fade like ordinary twin tube shocks. Fits front of 73 - 83 Chevelle, 73 - 88 Monte Carlo, Buick Regal.', '', '304');
