insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('7', '1', '350 Chevy - Dart Iron SS Series 67cc 2.02/ 1.60 Cylinder Heads', 'Pair of assembled Dart SS series heads # 10024266.  Cylinder heads are for carbureted small block 327, 350, 377, 383 or 400 engines. (377 & 400 applications for street would require steam holes to be drilled) 67cc, heart shaped combustion chambers. Straight plug design. High flow 165cc intake runners. Integral valve guides. These heads are assembled in our machine shop. Seat concentricy is checked, mild bowl blending is done to remove any casting intrusions. Assembled with premium stainless swirl polished 2.02 intake valves and 1.60 exhaust valves with undercut stems for improved flow. New .550 lift Z-28 valve springs, new steel retainers, hardened locks, and umbrella valve seals. Screw in rocker arm studs (3/8\") and guideplates are also included. ( Dual springs w/damper option is available for an additional $80.00. Dual springs are 1.44 O.D. with 135# of seat pressure and will handle up to .600 lift. Dual spring option also includes chrome moly retainers and machined valve locks.)All machine work is done in our own shop on quality equipment.', '', '2615');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('8', '1', 'Pistons - 383 Flat Top - Coated Skirts', 'Set of 8 Speed Pro #H860CP hypereutectic pistons.  Duro Shield coated skirts. Flat top pistons with 2 valve reliefs. 5/64\", 5/64\", 3/16\" ring grooves. For use with 5.7\" length rods. Compression with 64cc heads is approx. 10 to 1, with 76cc heads is approx. 9 to 1. Includes snap rings, pistons can be pressed or full floated. Gram weights between sets vary but are approx. 535 grams piston weight.', '', '242');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('9', '1', 'Pistons - 383 - .200 Dome-Coated Skirts', 'Set of 8 Speed Pro #H635CP hypereutectic pistons.  Duro Shield coated skirts. Pistons have .200 dome. 5/64\", 5/64\", 3/16\" ring grooves. For use with 5.7 length rods. Compression with 64cc heads is approx. 12.4 to 1, with 76cc heads is approx. 10.7 to 1. Includes snap rings, pistons can be pressed or full floated. Gram weights between sets vary buy are approx. 545 grams piston weight and 160 grams pin weight.', '', '396');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('10', '1', '350 Chevy 882 Performance Heads 76cc -  2.02/1.60', 'Pair of casting #333882 heads with intake valve size increased to 2.02, 1.60 exhaust valves. Approx. 76cc combustion chamber. These heads will work on the street with unleaded fuel and have bolt holes on ends of heads for all accessories. These heads are for carbureted engines. Three angle valve job, surfaced, new valve guides, assembled with new premium stainless 2.02 intake valves and 1.60 exhaust valves with necked down stems. New .550 lift Z-28 valve springs, new steel retainers and hardened valve locks, umbrella valve stem seals. Heads have 3/8\" press in rocker studs. All machine work is done in our own shop on quality equipment.', '', '703');
