insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('38', '1', 'GM-KRC V-Belt P.S. Kit / Steel Pump', 'KRC Small block Chevy power steering kit. Complete with all new steel pump with V belt pulley, pump mount bracket, reservoir and a reservoir bracket. Your choice of cylinder head or block mount pump bracket. The reservoir uses a #6 fitting on the side and a #10 on the bottom.', '', '339');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('40', '1', 'Steering Wheel - Aluminum', 'Aluminum steering wheel. 3\" dish. Your choice of 15\" or 17\" diameter.', '', '327');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('41', '1', 'Economy SA2000 Helmet - RCI', 'RCI SFI certified SA2000 Helmet. Available in white only. We only have  size  Medium left in stock. This helmet sells for $249.95 at Summit.  Multi laminated fiberglass shell, form fitting fire resistant Nomex liner, Kevlar chin strap, large countoured eyeport, clear .125 lexan shield with thumb tab, fully adjustable detent shield pivot with tearoff posts, adjustable chin and forehead fresh air vents.TO ENSURE AN ACCURATE FIT. Carefully measure around your head, above the ears. Take the measurement in inches, referring to the sizing chart below for your correct helmet / hat size. Helmet must fit properly for optimum performance. Don\'t guess your size. Helmet must be securely and snugly fastened before engaging in any activity.
(21 5/8\" - 22\" - small -7), (22 3/8\" - 22 3/4\" - medium - 7 1/4), (23 1/8\" - 23 5/8\" - large - 7 1/2), (23 7/8\" - 24 1/2\" - X-large - 7 3/4), (24 3/4 - 25 1/8\" - XX-large - 7 7/8) !!!!!!!!!! WE ARE CURRENTLY SOLD OUT OF SIZE SMALL, LARGE, X-LARGE & XXL. SA2005 VERSIONS OF THIS HELMET ARE COMING OUT SOON !!!!!!!      (Use Kirkey # S1001 tearoffs)', '', '618');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('42', '1', 'Window Net - Mesh Style', 'Mesh style window net. Measures 18\" X 23 1/2\".  Your choice of black, red or blue. NOT SFI RATED', '', '302');
