insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('45', '1', 'Ultra Shield Adult Single Layer Driving Gloves', 'Pair of Ultrashield single layer driving gloves, SFI spec 3.3/1. Padded leather palm and knuckle area with Velcro closure on arm.  Your choice of black, blue, or red. Sizes S, M, L or XL.( Glove sizing - Measure around the largest part of your hand, over your knuckles while making a fist, excluding thumb. Glove size - Small - 7\"-8 1/2\", Medium - 8\"-9 1/2\", Large - 9\"-10 1/2\", X-Large -  10\"-11 1/2\" )', '', '936');
