insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('57', '1', 'Stewart Stage 2 Aluminum SB Chevy Water Pump - Short', 'Short style SBC Stewart Components Stage 2 aluminum water pump. 356-T6 heat-treated aluminum castings. Heavy duty bearing and hub. More efficient impeller. Drilled and tapped for cam stop. Can be drilled and tapped for external lines. Your choice of water pump #22103 with a 5/8\" diameter shaft or #22203 with a 3/4\" diameter shaft. Guranteed for one year. (Short style pump measures 5 7/8\" from leg of pump to face of fan hub.)', '', '285');
