insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('73', '1', 'SB Chevy Performance Heads-68cc - 1.94/1.50', 'Pair of casting # 14014416 heads with intake valve size increased to 1.94, 1.50 exhaust valves, combustion chamber walls are cut around valves to clear domed pistons and unshroud valves for better air flow, combustion chamber size is approx. 68cc for increased compression ratio.(These castings were originally from 305 engines) These heads will work on the street with unleaded fuel and have bolt holes on ends of heads for all accessories. These heads are for carbureted engines. Three angle valve job, surfaced, new valve guides, assembled with new premium stainless valves with necked down stems, new .550 lift Z-28 valve springs, new steel retainers and hardened valve locks, umbrella valve seals. These heads have 3/8\" press in studs.', '', '367');
