insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('114', '1', 'Cloyes - SBC Hex-Adjust True Roller Timing Set', 'With a Cloyes Hex-a-just timing system infinitely adjustable cam timing is as simple as turning an allen wrench. Consisting of billet steel cam and crank sprockets and a Cloyes True roller timing chain, the system uses a special hex head bushing installed on your cam\'s dowel pin. This bushing lines up with degree marks on the cam sprocket. You can adjust timing in fractions of a degree (up to plus or minus six degrees) by loosening the cam bolts and turning the bushing with an allen wrench. The Hex-a-just system fits under your stock timing cover. A torrington needle thrust bearing is also included. NOTE:  This set is for 1955 - 1987 small block chevy motors except for engines with a factory roller cam.', '', '333');
