insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('209', '1', 'Cloyes - SBC True Roller Timing Set', 'True roller action timing chain for superior durability, roller links are made from high quality heat-treated cast iron or SAE D7003 ductile iron, roller links are rolled and hardened to exacting standards, the crank sprockets have 3 patented keyways and are made from high quality carbon steel heat-treated to Rc 48 minumum. Precision matched for precise chain tension. This set is for 1955 - 1987 small block chevy motors except engines with factory roller cams.', '', '374');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('210', '1', 'Chevy 350 Rering Kit - Fel-pro - Clevite', 'Rering kit includes Fel Pro #KS2600 overhaul gasket set, fits 68-79 350 chevy engines (drivers side dipstick blocks). Clevite rod bearing set #CB663P, Clevite main bearing set #MS909P and 5/64\", 5/64\", 3/16\" cast Hastings rings #139. Your choice of std., .030, .040 or .060 over rings, std., .010, .020, or .030 under rod and main bearings.', '', '417');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('211', '1', '350 Chevy Engine Kit', 'Kit contains Fel Pro overhaul gasket set # 260-1000 for 350 engines 69-79(drivers side dipstick blocks). Sealed Power flat top hypereutectic pistons #H345NP. Clevite rod bearing set # CB663P, Clevite main bearing set # MS909P, Clevite cam bearing set # SH290S. 5/64, 5/64, 3/16\" cast Hastings rings #139. Melling # 10550 M-Select high volume oil pump with heavy duty oil pump shaft. Brass frost plug kit. Your choice of std. .030, .040, or .060 over pistons and std., .010, .020, or .030 under rod and main bearings. (Other piston options and moly rings are available at additional cost such as 2VR flat tops or domed versions - call for quote)', '', '1331');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('610', '1', 'Pistons - 350 - Flat Top - Cast', 'set of 8 Sealed Power # 345NP .030 cast aluminum pistons. (STD., .040 or .060 are available upon request) (These pistons sell for $112.00 a set at Jegs. Flat top pistons with 4 valve reliefs. 5/64\", 5/64\", 3/16\" ring grooves.( For use with 5.7\" rods (stock 350 rod length) Compression with 64cc heads is approx. 9.4 to 1, with 76cc heads is approx. 8.4 to 1. Pistons are for press fit rods only.', '', '183');
