insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('215', '1', 'Pro-Street Stock Shock-GM Rear', 'Pro SS201 shock. Fits rear of GM full- size and mid-size Chevelle, Monte Carlo, Cutlass, and Regal. Compressed length is 12.75\", extended length is 20.95\". SS series have extra heavy damping designed for the rigors of street stock racing.', '', '237');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('216', '1', 'Pro-Street Stock Shock-GM Front', 'Pro SS100 shock. Fits front of GM full-size and mid-size. Compressed length is 8.5\", extended length is 13.1\". This series is non adjustable. SS series have extra heavy damping designed for the rigors of street stock racing.', '', '243');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('183', '1', 'MSD Blaster 2 Coil', 'Special 100:1 windings are used to provide maximum buildup of voltage! These windings are kept secure and cool in an oil filled metal canister. The tower assembly is molded of alkyd material. Wide spaced brass primary terminals help prevent the possibility of spark jump.', '', '275');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('184', '1', 'MSD - Blaster 2 Coil - High Vibration', 'For circle track, off road and other severe duty racing applications, this is the coil! The windings of the High Vibration Coil are completely encased in a premium epoxy making it impossible for vibration to affect the windings. This assembly is housed in a unique alkyd molded shell which provides high dielectric characteristics plus a very durable shell. Brass primary terminals ensure full voltage delivery and are spaced far apart to eliminate the chance of spark arc-over. The High Vibration Coil can be mounted in any position and can be used with a standard canister coil mount.
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('185', '1', 'MSD - #6400 Ignition Box', 'Works with MSD distributors and most stock distributors. The 6T is designed for severe duty applications such as off-road and circle track racing. The circuits receive extra vibration protection in the form of additional internal bracing and a heavy duty coating of Humi-Seal. This coating protects the circuitry from harsh vibrations and moisture, plus rubber vibration mounts are included. A special 4-wire connector will plug directly into an MSD Soft Touch Rev Control (PN 8738 or Engine Control (PN 8968).
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('186', '1', 'MSD - #6420 Ignition Box', 'Works with MSD ditributors and most stock distributors. The 6AL shares the same proven circuitry of the 6A with the addition of a built-in adjustable rev limiter. 
