insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('222', '1', '350 Chevy - Dart Iron SS Series 76cc 2.02/ 1.60 Cylinder Heads', 'Pair of assembled Dart SS series heads # 10024267.  Cylinder heads are for carbureted small block 327, 350, 377, 383 or 400 engines. (377 & 400 applications for street would require steam holes to be drilled) 76cc, heart shaped combustion chambers. Straight plug design. High flow 165cc intake runners. Integral valve guides. These heads are assembled in our machine shop. Seat concentricy is checked, mild bowl blending is done to remove any casting intrusions. Assembled with premium stainless swirl polished 2.02 intake valves and 1.60 exhaust valves with undercut stems for improved flow. New .550 lift Z-28 valve springs, new steel retainers, hardened locks, and umbrella valve seals. Screw in rocker arm studs (3/8\") and guideplates are also included. ( Dual springs w/damper option is available for an additional $80.00. Dual springs are 1.44 O.D. with 135# of seat pressure and will handle up to .600 lift. Dual spring option also includes chrome moly retainers and machined valve locks.)All machine work is done in our own shop on quality equipment.', '', '1133');
