insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('320', '1', 'Ultra Shield Adult 2-Piece Single Layer Driving / Racing Suit', 'THIS STYLE SUIT IS BEING REPLACED IN 2008  BY SUITS WITHOUT THE WHITE  STRIPES ON THE SIDES. PLEASE CALL AHEAD FOR AVAILABILITY OF COLORS AND SIZES OF THIS STYLE. Ultra Shield 2 piece single layer driving suit, includes jacket and pants. SFI spec 3.2A/1 . Made from the highest quality 100% flame retardent materials available, with Nomex cuffs and Nomex lined brass zippers. Shoulder epaulettes. Color matching cuffs. Sporty stripes and trim detail. Jacket and pants sizes can be mixed. Your choice of Black, Blue, or Red. Jacket sizes available are ( Small - 38\"- 41\" chest ) ( Medium - 42\"- 44\" chest ) ( Large - 45\"- 49\" chest ) ( X-Large - 50\"- 53\" chest ) ( XX-Large 54\"- 56\" chest ) ( XXX-Large - 56\"- 57\" chest ). Pants sizes available are ( Small - 28\"- 30\" waist ) ( medium - 31\"- 33\" waist ) ( large - 34\"- 39\" waist ) ( X-Large - 40\"- 44\" waist ) ( XX-Large - 45\"- 49\" waist ) ( XXX-Large - 50\"- 51\" waist ), XX-Large sizes and XXX-Large sizes are an additonal $5.00 per piece. WE WILL GLADLY EXCHANGE SIZES IF THE FIT ISNT TO YOUR LIKING ALTHOUGH THE CUSTOMER WILL INCUR THE COST OF SHIPPING.', '', '1283');
