insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('322', '1', 'R.J.S. - Seat Belt Kit - Wrap Around Style', 'This kit allows you to mount your belts by looping each individual shoulder harness around a roll bar or similar structural tube running horizonally behind the driver and below the shoulders. It includes a 3\" latch type lap belt, two individual 3\" shoulder harness belts and a 2\" sub belt. All belts have current dates and meet SFI 16.1 rating. Available in black, red, blue, purple or gray. Kit includes hardware to bolt belts to the floor.', '', '419');
