insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('393', '1', 'Ultra Shield Driving/Racing Jacket', 'Ultra Shield single layer driving jacket. SFI spec 3.2A/1 . Made from the highest quality 100% flame retardent materials available, with Nomex cuffs and Nomex lined brass zippers. Shoulder epaulettes. Color matching cuffs. Sporty stripes and trim detail. Your choice of Black, Blue or Red. Jacket sizes available are ( Small - 38\"- 41\" chest ) ( Medium - 42\"- 44\" chest ) ( Large - 45\"- 49\" chest ) ( X-Large - 50\"- 53\" chest ) ( XX-Large 54\"- 56\" chest ) ( XXX-Large - 56\"- 57\" chest ), XX-Large and XXX-Large sizes are an additonal $5.00. WE WILL GLADLY EXCHANGE SIZES IF THE FIT ISNT TO YOUR LIKING ALTHOUGH THE CUSTOMER WILL INCUR THE COST OF SHIPPING.', '', '399');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('394', '1', 'Fuel Cell - Jaz 12 Gal. Circle Track with Can', 'All Jaz fuel cells have a seamless cross-linked inner shell. The can is made of 20 gauge steel, then powder coated red. A D-ring bail handle cap is used with a check valve vent that closes if the cell gets upside down. They come standard with #8 vent with a rollover valve, and #8 pickup with the hose routed to right rear corner. Dimentions: 18\" long x 16.5\" wide x 10.5\" deep.', '', '634');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('395', '1', 'Fuel Cell - Jaz 16 Gal. Circle Track with Can', 'All Jaz fuel cells have a seamless cross-linked inner shell. The can is made of 20 gauge steel, then powder coated red. A D-ring bail handle cap is used with a check valve vent that closes if the cell gets upside down. They come standard with #8 vent with a rollover valve, and #8 pickup with the hose routed to right rear corner. Dimentions: 26\" long x 18\" wide x 9.5\" deep.', '', '646');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('396', '1', '350 Chevy 993 Performance Heads 76cc -  2.02/1.60', 'Pair of casting #993 heads with intake valve size increased to 2.02, 1.60 exhaust valves. Approx. 76cc combustion chamber. These heads will work on the street with unleaded fuel and have bolt holes on ends of heads for all accessories. These heads are for carbureted engines. Three angle valve job, surfaced, new valve guides, assembled with new premium stainless 2.02 intake valves and 1.60 exhaust valves with necked down stems. New .550 lift Z-28 valve springs, new steel retainers and hardened valve locks, umbrella valve stem seals. Heads have 3/8\\\" press in rocker studs. All machine work is done in our own shop on quality equipment.', '', '7');
