insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('468', '1', 'Wilwood Forward Mount Dual Pedal Assembly -6.25:1 Ratio', 'Dual pedal assembly, forward mount.  6.25:1 ratio.  Lightweight construction only 3.7 lbs. High strength computer design. Includes brake balance bar. High strength steel master cyinder mounting studs. Easy mounting location. Non-slip pedals.  First quality hardware. Fully anodized finish.', '', '635');
