insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('469', '1', 'Wilwood Reverse Mount Dual Pedal Assembly -6.25:1 Ratio', 'Dual pedal assembly, reverse mount. 6.25:1 ratio. Lightweight construction only 3.7 lbs. High strength computer design. Includes brake balance bar. High strength steel master cylinder mounting studs. Easy mounting location. Non-slip pedals. First quality hardware. Fully anodized finish.', '', '636');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('472', '1', 'CLOSEOUT DRIVING JACKETS', 'CLOSEOUT on  Ultrashield old style jackets, single layer banox with nomex cuffs, SFI 3-2A/1. We have size small (38\"- 41\" chest) in  red only left. CALL TO CHECK AVAILABILITY AND PLACE AN ORDER AS WE HAVE A LIMITED NUMBER OF THESE JACKETS.', '', '388');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('562', '1', 'Pistons - 454 Flat Top Forged Pistons - Coated Skirts', 'Set of 8 Speed Pro # L2377F  Forged pistons. Available in .030, .040 or .060. CNC machined. DurOshield coated skirts. Flat top pistons with 2 valve reliefs and chamfered edge. 5/64\", 5/64\", 3/16\" ring grooves. For use with stock 454 rod length. Compression with 100.9cc heads is approx. 8.72 to 1, with 106.9cc heads is approx. 8.36 to 1, with 109.4cc heads is approx. 8.22. Pistons are for press fit rods only.', '', '351');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('473', '1', 'Pistons - 350 Flat Top Forged Pistons - Coated Skirts', 'Set of 8 Sealed Power # L2256F  Forged pistons. CNC machined. Duro Shield coated skirts.  Flat top pistons with 4 valve reliefs. 5/64\", 5/64\", 3/16\" ring grooves. For use with 5.7\" rods (stock 350 rod length) Compression with 64cc heads is approx. 9.7 to 1, with 76cc heads is approx. 8.6 to 1. Pistons are for press fit rods only. Gram weights between sets vary but are approx. 612 grams piston weight and 145 grams pin weight.', '', '570');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('471', '1', 'G-Force Pro Force 1 Graphix Helmet', 'G-Force Pro Force 1 graphix helmet #5405. Size Small 6-7/8-7, Medium 7-1/8-7-1/4, Large -7 3/8 -7 1/2, X-Large 7-5/8-7-3/4, XX-large7-7/8-8.  SA 2005 certified. Lightweight composite shell, Fire-retardant interior,  G-Flow ventilation, Black only. The Pro - Force 1 Graphix is a new helmet with super sleek styling. A Z38 composite shell keeps this helmet light on your shoulders. Keep cool with the integral G - Flow ventilation system that brings in cool air and vents the hot air out of the top and back of the helmet. A Cool Tec liner helps keep you comfortable.  Helmet includes factory mounting points for the G-FORCE racing gear SRS-1 helmet restraint system. ( Use Kirkey # S1003 tearoffs )', '', '329');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('474', '1', 'JET - Rochester 500cfm 2GC Carbureter', 'The Circle Track 500CFM 2G begins with a .130 needle and seat assembly for adequate fuel supply and a small diameter float for maximum float bowl volume. The cluster is modified to keep the fuel curve correct throughout the RPM range. Tapped to accept Holley jets for ease of tuning and finished with a 3/8\" fuel inlet. Factory color diechromate. (We have had an IMCA tech official check these carbs for legality in IMCA hobby stock and have been told the carb is legal.) Note: This 2G is modified to 500 CFM from a smaller core. The casing ridge has been removed but it will pass a gauge test. Venture size: 1 3/8\", Bore size: 1 11/16\".', '', '854');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('477', '1', 'Pistons - 383 Dish Top - Coated Skirts', 'Set of 8 Speed Pro #H859CP hypereutectic pistons.  Duro Shield coated skirts. Dish top pistons with .110 dish and 2 valve reliefs. 5/64\", 5/64\", 3/16\" ring grooves. For use with 5.7\" length rods. Compression with 64cc heads is approx. 9.7 to 1, with 76cc heads is approx. 8.7 to 1. Includes snap rings, pistons can be pressed or full floated. Gram weights between sets vary but are approx. 511 grams piston weight.', '', '195');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('478', '1', 'Pistons - 383 - SRP - L.W. - Dome - 5.7\" Rod', 'Set of 8 SRP lightweight Forged dome pistons. For use with 5.7\" rods. CNC machined domes with radiused valve reliefs provide optimum flame travel. Designed for use with most popular 23 degree heads. Forged from premium2618 aluminum alloy. Pin fitting and double spiro locks included. 927-2750 - 150 wall wrist pins included(130 grams). CNC machined ring grooves accept 1/16\", 1/16\", 3/16\" rings. Compression with 64cc heads is approx. 12.9 to1, with 70cc heads is approx. 11.9 to 1. Piston weight in .030 is approx. 483 grams, pinweight is 130 grams.', '', '156');
