insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('486', '1', 'Eagle - SB Chevy 5.7\" H-Beam Rods - Bushed', 'Set of 8 - 5.7\" long connecting rods. 4340 steel. H-beam construction. Sized and balanced to +/- 1 gram. 190,000 p.s.i. ARP capscrews. Approx. weight is 630 grams. Each rod set is double checked in our machine shop for roundness and pin fit. Rods are for 1968 and newer cranks. Cam clearencing is available for large stroke applications.', '', '340');
