insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('488', '1', '350 - Eagle - SBC - 4340 Steel Crankshaft - 3.48 Stroke', 'Eagle 350 Chevy 4340 steel crankshaft. Internally balanced. Designed for 2-piece rear main seal blocks. For use with 5.7\" or 6.0\" rods. Must use chamfered rod and main bearings. Forged 4340 Steel non-twisting forging. Cranks are 100% x-rayed, magnafluxed & sonic-tested. .125\" radius on rod and main journals for increased strength. Cross-drilled And chamfered oil holes for improved oiling. Nitrided journal surfaces for superiour wear resistance. Stress relieved & shot peened. Indexed for correct stroke. Multi-stage heat treat process. Full counterweight designed for easy balancing. Precision ground & micro-polished journals.', '', '387');
