insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('493', '1', 'SBC - Dart Iron Eagle Platinum Heads - 64cc - 2.02/1.60 - 200cc', 'Pair of assembled Dart Iron Eagle Platinum cylinder heads for carbureted small block Chevy engines (ALLOW 2-3 DAYS FOR OUR SHOP TO CUSTOM ASSEMBLE A PAIR OF HEADS FOR YOU). 377 and 400 applications for street would require steamholes to be drilled. These heads are assembled in our machine shop. Seat concentricity and valve guide clearance is checked and valve springs are installed at the correct installed height. Heads are assembled with premium stainless swirl polished 2.02 intake valves and 1.60 exhaust valves with undercut stems for increased flow. Hardened steel retainers, hardened locks and high temperature positive Viton seals. Screw in rocker arm studs (3/8\") and guideplates are also included. Assembled with Comp Cams #982 conical single valve springs  with 110# of seat pressure and will handle up to  .550 lift. (Dual springs w/damper option is available for an additional $80.00. Dual springs are 1.44 O.D. with 135# of seat pressure and will handle up to .600 lift. Dual spring option also includes chrome moly retainers and machined valve locks.) Dart has introduced the next generation Iron Eagle small block Chevy cylinder head - The Platinum Series. Speed Flow Technology has produced more efficient port designs with improved velocity and airflow. Combustion chambers have been redesigned for improved breathing and controllable combustion efficiency and fit most standard pistons. Multi-angle seats and radiused exhaust seats dramatically increase flow. Hardened exhaust seats are compatible with unleaded fuel. Manganese bronze intake valve guides and phosphorous bronze exhaust valve guides. Accepts most stock bolt on components.', '', '602');
