insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('499', '1', 'SBC - Dart Iron Eagle Platinum Heads - 49cc - 2.02/1.60 - 200cc', 'MUST USE FLAT TOP OR DISH PISTONS. 49cc HEADS COME IN ANGLE PLUG ONLY. VALVE TO PISTON CLEARANCE MUST BE CHECKED AS THE VALVES IN THE 49cc HEADS ARE MOVED DOWN .100 CLOSER TO THE PISTON. Pair of assembled Dart Iron Eagle Platinum cylinder heads for carbureted small block Chevy engines (ALLOW 2-3 DAYS FOR OUR SHOP TO CUSTOM ASSEMBLE A PAIR OF HEADS FOR YOU). 377 and 400 applications for street would require steamholes to be drilled. These heads are assembled in our machine shop. Seat concentricity and valve guide clearance is checked and valve springs are installed at the correct installed height. Heads are assembled with premium stainless swirl polished 2.02 intake valves and 1.60 exhaust valves with undercut stems for increased flow. Hardened steel retainers, hardened locks and high temperature positive Viton seals. Screw in rocker arm studs (3/8\") and guideplates are also included. Assembled with Comp Cams #982 conical single valve springs with 110# of seat pressure and will handle up to  .550 lift. (Dual springs w/damper option is available for an additional $80.00. Dual springs are 1.44 O.D. with 135# of seat pressure and will handle up to .600 lift. Dual spring option also includes chrome moly retainers and machined valve locks.) Dart has introduced the next generation Iron Eagle small block Chevy cylinder head - The Platinum Series. Speed Flow Technology has produced more efficient port designs with improved velocity and airflow. Combustion chambers have been redesigned for improved breathing and controllable combustion efficiency and fit most standard pistons. Multi-angle seats and radiused exhaust seats dramatically increase flow. Hardened exhaust seats are compatible with unleaded fuel. Manganese bronze intake valve guides and phosphorous bronze exhaust valve guides. Accepts most stock bolt on components.', '', '778');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('500', '1', 'SBC - Dart Iron Eagle Platinum Heads - 49cc - 2.05/1.60 - 215cc', 'MUST USE FLAT TOP PISTONS. 49cc HEADS COME IN ANGLE PLUG ONLY. PISTON TO VALVE CLEARANCE MUST BE CHECKED AS THE VALVES ARE MOVED DOWN .100 CLOSER TO THE PISTON IN THE 49cc HEADS. Pair of assembled Dart Iron Eagle Platinum cylinder heads for carbureted small block Chevy engines (ALLOW 2-3 DAYS FOR OUR SHOP TO CUSTOM ASSEMBLE A PAIR OF HEADS FOR YOU). 377 and 400 applications for street would require steamholes to be drilled. These heads are assembled in our machine shop. Seat concentricity and valve guide clearance is checked and valve springs are installed at the correct installed height. Heads are assembled with premium stainless swirl polished 2.02 intake valves and 1.60 exhaust valves with undercut stems for increased flow. Hardened steel retainers, hardened locks and high temperature positive Viton seals. Screw in rocker arm studs (3/8\") and guideplates are also included. Assembled with Comp Cams #982 conical single valve springs  with 110# of seat pressure and will handle up to  .550 lift. (Dual springs w/damper option is available for an additional $80.00. Dual springs are 1.44 O.D. with 135# of seat pressure and will handle up to .600 lift. Dual spring option also includes chrome moly retainers and machined valve locks.) Dart has introduced the next generation Iron Eagle small block Chevy cylinder head - The Platinum Series. Speed Flow Technology has produced more efficient port designs with improved velocity and airflow. Combustion chambers have been redesigned for improved breathing and controllable combustion efficiency and fit most standard pistons. Multi-angle seats and radiused exhaust seats dramatically increase flow. Hardened exhaust seats are compatible with unleaded fuel. Manganese bronze intake valve guides and phosphorous bronze exhaust valve guides. Accepts most stock bolt on components.', '', '571');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('501', '1', 'Ultra Shield Youth 2-Piece Single Layer Driving / Racing Suit', 'Youth single layer 2 piece Ultrashield driving suit. Includes jacket and pants. SFI spec 3.2A/1. Made from the highest quality 100% flame retardent materials available with Nomex cuffs and Nomex lined brass zippers. Shoulder epaulettes. Color matching cuffs. Sporty stripes and trim detail. Available in Black, Red or Blue. Sizes available are Small (8-10), Medium (12-14), Large (16 - 18). WE WILL GLADLY EXCHANGE SIZES IF THE FIT ISNT TO YOUR LIKING ALTHOUGH THE CUSTOMER WILL INCUR THE COST OF SHIPPING.', '', '329');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('502', '1', 'Pistons - 350 - SRP - L.W. - Flat Top - 5.7\" Rod', 'Set of 8 SRP lightweight Forged Flat top pistons. For use with 5.7\" rods. Ideal for oval track to street/strip applications. Forged from 4032 low expansion high silicon aluminum alloy heat treated to SRP specifications. Forced pin oiler for increased wrist pin lubrication. Pin fitting and double spiro locks included. 927-2750 - 150 wall wrist pins included. (130 grams). CNC machined ring grooves accept 1/16\", 1/16\", 3/16\" rings. Compression with 64cc heads is approx. 10.3 to1, with 70cc heads is approx. 9.6 to 1. Piston weight in .030 is approx. 497 grams.', '', '244');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('503', '1', 'G-Force Pro Force 1 Helmet', 'G-Force Pro Force 1 helmet #5408. Size Small 6-7/8-7, Medium 7-1/8-7-1/4, Large -7 3/8 -7 1/2, X-Large 7-5/8-7-3/4, XX-large7-7/8-8.  SA 2005 certifiied. Lightweight composite shell, Fire-retardant interior,  G-Flow ventilation, White only. A Z38 composite shell keeps this helmet light on your shoulders. Keep cool with the integral G - Flow ventilation system that brings in cool air and vents the hot air out of the top and back of the helmet. A Cool Tec liner helps keep you comfortable. Helmet includes factory mounting points for the G-FORCE racing gear SRS-1 helmet restraint system. ( Use Kirkey S1003 tearoffs. )', '', '483');
