insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('518', '1', 'Pistons - 400 Dish Top - Coated Skirts', 'Set of 8 Speed Pro #H615CP hypereutectic pistons. Duro Shield coated skirts. Dish top pistons with .135 dish and 4 valve reliefs. 5/64\", 5/64\", 3/16\" ring grooves. For use with 5.7\" length rods. Compression with 64cc heads is approx. 10.1 to 1, with 76cc heads is approx. 9.1 to 1. Includes snap rings, pistons can be pressed or full floated. Gram weights between sets vary but are approx. 579 grams piston weight.', '', '172');
