insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('524', '1', 'Pistons - 383 - 6IN Rod - Coated Skirts', 'Set of 8 Speed Pro #H124CL lightweight CNC machined 383 Chevy hypereutectic flat top pistons with 2 valve reliefs. DurOShield coated skirts.  For use with 6.0\" rods. 1/16\", 1/16\", 3/16\" ring grooves. Compression with 64cc heads is approx. 10.5 to 1, with 76cc heads is approx. 9.3 to 1. Includes snap rings, pistons can be pressed or full floated. Gram weights between sets vary but are approx. 560 grams piston weight and 126 grams pin weight.', '', '378');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('525', '1', 'Impact - Mini Champ Youth Helmet - Silver', 'Impact Racing Mini Champ Youth helmet. Made in the USA. Finding and fitting a helmet for your constantly growing 5 to 10 year old racer just got simpler. The Mini Champ youth helmet with Quick-Fit Inserts is designed to grow with your young racer all the way to adult size. The Quick-Fit memory foam sizing pads (included) makes fitting and refitting the Mini Champ fast and easy. A single Mini Champ helmet fits youth sizes small, medium and large. You can even custom shape the inserts for hard to fit or in between sizes. The Mini Champ youth helmets are SFI 24.1 approved (youth helmet standard) for QMA/WKA/NHRA/IKF use.', '', '662');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('526', '1', 'Impact - Charger Helmet - Silver', 'Impact Racing Charger helmet. (Charger is also available in black.) Made in the USA. Snell SA2005 rated. The Charger features a oversized wrap around eyeport for wide angle panoramic vision. Impact\'s computer generated shell and liner are matched to offer a secure, comfortable and consistent fit. Something you will appreciate every time you put the helmet on. Available in   sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Use Kirkey # S1021 tearoffs. )', '', '626');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('527', '1', 'Impact - Charger Helmet - Black', 'Impact Racing Charger helmet. (Charger is also available in silver.) Made in the USA. Snell SA2005 rated. The Charger features a oversized wrap around eyeport for wide angle panoramic vision. Impact\'s computer generated shell and liner are matched to offer a secure, comfortable and consistent fit. Something you will appreciate every time you put the helmet on. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". (Use Kirkey #S1021 tearoffs. )', '', '865');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('528', '1', 'Impact - Champ Helmet - Gloss Black', 'Impact Racing Champ helmet. (Champ helmet is also available in silver, white or flat black.) Made in the USA. Snell SA2005 rated. The Champ features a radical chinbar design that extends coverage over the mouth and nose and acts as a breath deflector. The expanded eyeport is designed to work in every racing cockpit. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Uses Kirkey # S1022 tearoffs and tearoff buttons must be relocated. )', '', '947');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('529', '1', 'Impact - Champ Helmet - Silver', 'Impact Racing Champ helmet. (Champ helmet is also available in gloss  black, flat black or white.) Made in the USA. Snell SA2005 rated. The Champ features a radical chinbar design that extends coverage over the mouth and nose and acts as a breath deflector. The expanded eyeport is designed to work in every racing cockpit. Available in sizes Small - 6 7/8\\\"-7\\\", Medium - 7 1/8\\\"-7 1/4\\\", Large - 7 3/8\\\"-7 1/2\\\", X-Large - 7 5/8\\\"-7 3/4\\\". ( Uses Kirkey #S1022 tearoffs and tearoff buttons must be relocated .)', '', '783');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('530', '1', 'Impact - Super Sport Helmet - Gloss Black', 'Impact Racing Black Super Sport helmet. (Super Sport also available in silver or white and limited availabilty in flat black.) Made in the USA. Snell SA2005 rated. From the wide eyeport design to the perfect fit and feel the Super Sport is at home in any race car cockpit. Slotted forehead vents. Chinbar vents allow fresh air intake and helps prevent exhale from fogging shields. Hand laminated composite shell for a lightweight helmet. Tear-off posts and metal shield pivot hardware. Fire resistant Kevlar chin strap with locking dual D-rings. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\".', '', '749');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('531', '1', 'Impact - Super Sport Helmet - Silver', 'Impact Racing Silver Super Sport helmet. (Super Sport also available in black, white or flat black.) Made in the USA. Snell SA2005 rated. From the wide eyeport design to the perfect fit and feel the Super Sport is at home in any race car cockpit. Slotted forehead vents. Chinbar vents allow fresh air intake and helps prevent exhale from fogging shields. Hand laminated composite shell for a lightweight helmet. Tear-off posts and metal shield pivot hardware. Fire resistant Kevlar chin strap with locking dual D-rings. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\".', '', '460');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('532', '1', 'Impact - Helmet Bag', 'Extra-large size for helmet and accesories. Soft abrasion resistant lining. 2/3 radius zipper for easy access. Durable and tough nylon shell. Dual webbed handles with leather strap keeper. Black with yellow contrast stitching.', '', '445');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('533', '1', 'Impact - Gear Bag', '27\" long x 12\" wide x 11\" deep. 3-compartment design for helmet, suit, gloves, shoes and accessories. One large center compartment with top loading full access 3/4 zipper. Two side compartments with 3/4 wrap around zippers for easy access.', '', '716');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('534', '1', 'Impact - Seat Belt Kit - Individual Style Harness', 'Impact seat belt kit with Individual style shoulder harness. Includes SFI 16.1 certification and current date. Made in the USA. Single anti-sub belt. Quick release latch and link forged for quality, strength and durability. Belt centering system on pull ends help center webbing in adjusters after tightening for proper webbing/hardware alignment. Contrast stitching on all webbing overlaps for immediate inspection of seam integrity.', '', '325');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('535', '1', 'Impact - Seat Belt Kit - V Style Shoulder Harness', 'Impact seat belt kit with V style shoulder harness. Made in the USA. Single anti-sub belt. Quick release latch and link forged for quality, strength and durability. Lever strap secures to webbing with hook & loop to prevent inadvertent release. Belt centering system on pull ends help center webbing in adjusters after tightening for proper webbing/hardware alignment. Contrast stitching on all webbing overlaps for immediate inspection of seam integrity.', '', '319');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('536', '1', 'Impact - High Top Driving Shoes', 'Super padded tonque and ankle collar for comfort and support. Plush knit fire-resistant interior with complete footbed anatomical support. Impact\'s sole design gives positive pedal control and feel with grooved bypass channels that allow air to pass under sole. Dual lacing system provides precision fit for narrow or wide feet. All Impact racing shoes are SFI approved. SFI labels are not included. FITTING NOTE: Driving shoes come in men sizes. Women should subtract 2 sizes to their shoe size for the proper fit. (RED AND BLUE SHOES ARE AVAILABLE BY SPECIAL ORDER. PLEASE CALL TO ORDER THESE COLORS.)', '', '758');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('537', '1', 'Impact - G2 Evolution Racing Gloves', 'Constructed of super soft, hand-hugging suede with a knit fire-resistant shell. Reversed outside seams on the palm side for a seamless fit and feel. Padded wrap-around palm patch and knuckle guard for extra comfort and abrasion resistance. Adjustable quick-fit closure. Available in Black, Red or Blue in sizes Small, Medium, Large or X-Large. ( Glove sizing - Measure around the largest part of your hand, over your knuckles while making a fist, excluding thumb. Glove size - Small - 7\"-8 1/2\", Medium - 8\"-9 1/2\", Large - 9\"-10 1/2\", X-Large -  10\"-11 1/2\" )', '', '421');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('538', '1', 'Impact - G1 Open Wheel Racing Gloves', 'Constructed of super soft, hand-hugging suede with a knit fire-resistant shell. Standard feel-less seams on both palm and back. Padded wrap-around palm patch and knuckle guard for extra comfort and abrasion resistance. Adjustable quick-fit closure. Available in Black, Red or Blue in sizes Small, Medium, Large or X-Large. ( Glove sizing - Measure around the largest part of your hand, over your knuckles while making a fist, excluding thumb. Glove size - Small - 7\"-8 1/2\", Medium - 8\"-9 1/2\", Large - 9\"-10 1/2\", X-Large -  10\"-11 1/2\" )', '', '67');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('539', '1', 'Fast - Lightweight Racer Series', 'This compact system is the lightest blower system in its class. This little blower is rated at 100cfm and weighs less than 2 lbs. Complete with a blower, mounting bracket, hose and washable filter.', '', '507');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('540', '1', 'Fast - Racer Series', 'This complete system was designed using a 12v squirrel cage blower. This blower kit is very durable . Complete with a 105 cfm blower, mounting bracket, hose and washable filter.', '', '467');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('541', '1', 'Fast - Pro Series', 'This complete Pro system is the finest blower system on the market today. With an all aluminum filter housing and stainless steel housing bolts this system is the most durable you will find. Complete with a 105cfm blower, mounting bracket, hose and paper filter.', '', '572');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('542', '1', 'Fast - Sidekick', 'This plug-on blower comes with a powerful 50cfm motor, 3M filtrate sock filter and a vibration free molded housing. Very popular among drivers from circle tracks to drag strips to sprint cars. Can be wired right into your 12v wiring system. ( A convenient 7.2v ni-cad battery system version is also available for $199.99 )', '', '447');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('543', '1', 'Pro-Street Stock Shock-Adjustable-GM Front', 'Pro SS100A shock. Fits front of GM full-size and mid-size. Compressed length is 8.5\", extended length is 13.1\". This shock will allow you to make three quick and painless adjustments. Simply compress shock together and click to preferred setting. ( 1 end of shock must be detached from mount to adjust shock ) Adjustment #1 - easy up for weight transfer. Adjustment #2 - 50/50 valving like a standard SS shock. Adjustment #3 - tiedown for slow weight transfer for pavement or heavy tracks.', '', '639');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('544', '1', 'Pro-Street Stock Shock-Adjustable-GM Rear', 'Pro SS201A shock. Fits rear of GM full-size and mid-size Chevelle, Monte, Regal, Cutlass, etc. Compressed length is 12.75\", extended length is 20.95\". This shock will allow you to make three quick and painless adjustments. Simply compress shock together and click to preferred setting. ( 1 end of shock must be detached from mount to adjust shock ) Adjustment #1 - easy up for weight transfer. Adjustment #2 - 50/50 valving like a standard SS shock. Adjustment #3 - tiedown for slow weight transfer for pavement or heavy tracks.', '', '623');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('545', '1', 'Rebco 2 Gauge Panel - FLAME', 'Rebco FLAME gauge panel with oil pressure and water temperature gauges. Rebco gauge panels feature Accutech Sportsman 2 5/8\" gauges with backlights. They are pre-wired for easy installation and unmatched reliability. They also come with sending units and warning lights to alert the driver of any problems under the hood.', '', '596');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('546', '1', 'Rebco 3 Gauge Panel - FLAME', 'Rebco FLAME gauge panel with oil pressure, water temperature and fuel pressure gauges. Rebco gauge panels feature Accutech Sportsman 2 5/8\" gauges with backlights. They are pre-wired for easy installation and unmatched reliability. They also come with sending units and warning lights to alert the driver of any problems under the hood.', '', '700');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('547', '1', 'US Brake - GM Metric Caliper', 'Stock metric GM caliper. Legal replacement for stock classes. Remanufactured casting. Stock appearing, 6.825 lbs. Assembled with new piston and internal parts. Quality control checked and pressure tested. Available for right or left side.', '', '591');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('548', '1', 'US Brake - GM Metric Caliper - Oversize', 'Fits all stock metric GM applications. Oversize 2 3/4\" piston provides approx. 20% more caliper clamping force for increased brake bias. Increases range of brake bias adjustment for better brake performance. Allows for more brake system tuneability. Stock appearing. 6.620 lbs. Assembled with new piston and internal parts. Quality control checked and pressure tested.', '', '560');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('549', '1', 'Afco Solid Panhard Bar', 'Made to fit over driveshaft. 20 1/2\" long. 3 1/2\" drop.', '', '592');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('550', '1', 'Afco Solid Panhard Bar - Kit', 'Uses long bar for special length applications. Cut to length and install bushing. 3 1/2\" Drop.', '', '623');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('552', '1', 'Rebuilt Chevy 350 Heads H.D. 1.72/1.50', 'Pair of casting # 3998991 heads with 1.72 / 1.50 valves. 76cc combustion chamber. This style head is usually from a 3/4 ton truck application. They are well suited for low RPM torque applications with the smaller 1.72 intake valve size. The exhaust valves in these heads have a larger 3/8\" diameter valve stem for improved exhaust valve cooling in heavy duty use. These heads will work on the street with unleaded fuel and have bolt holes on the ends for all accesories.These heads are for carbureted engines. Heads are oven baked and shot blasted. Magnafluxed to check for cracks. New cast iron valve guides are installed. Three angle valve job is done on valve seats. Valves are checked for wear and refaced. Heads are given a light surface to ensure flatness. Heads are assembled with new umbrella valve stem seals and new stock valve springs and hardened valve locks.These heads have 3/8\" press in studs. All machine work is done in our own shop on quality equipment.', '', '683');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('553', '1', 'G Force Adult 2 - Piece Multi Layer Driving / Racing Suit', 'G-Force GF505 triple layer 2 piece SFI 3-2A/5 driving suit. TPP rating of 26. (Helmet not included) We currently only stock this suit in black. (red and blue and other sizes may be available, please call)  Your choice of size Large or X-Large.(jacket and pants sizes can be mixed) (Large jacket size is 42\"-46\" chest) (XL jacket size is 46\"-49\"chest)  (Large pants size is 36\"-40\" waist) (XL pants size is 41\"-43\" waist) Suit comes standard with epaulets, matching Nomex cuffs,arm and leg stripes,and a large chest billboard with contrasting piping. The outer layer is fire retardent cotton. The interior of the 505 suit is lined with the world-renowned Cool Quilt liner. Dry = cool and this liner keeps you dry. The built in Abzorb-A-Line draws the moisture from the body and keeps the drivers body temperature down. All seams are safety stitched to help limit failure in a fire. WE WILL GLADLY EXCHANGE SIZES IF THE FIT ISNT TO YOUR LIKING ALTHOUGH THE CUSTOMER WILL INCUR THE COST OF SHIPPING.', '', '139');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('554', '1', '350 Chevy- Aluminum Strike Force 64cc 2.02/1.60 Cylinder Heads', 'New pair of assembled PBM Strike Force aluminum cylinder heads for carbureted small block 327, 350, 377, 383, or 400 engines.(ALLOW 2-3 DAYS FOR OUR SHOP TO CUSTOM ASSEMBLE A PAIR OF HEADS FOR YOU)
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('555', '1', 'Pistons - 350 - Flat Top Forged Pistons L.W.', 'New set of 8 Speed Pro # L2490F 350 Chevy lightweight Forged pistons.  CNC machined. DurOshield coated skirts.  Flat top pistons with 2 valve reliefs, 1/16\", 1/16\", 3/16\" ring grooves. For use with 5.7\" rods (stock 350 rod length). Compression with 64cc heads is approx. 9.7 to 1, with 68cc head is approx. 9.3 to 1, with 76cc heads is approx. 8.6 to 1. Includes snap rings, pistons can be pressed or full floated. Gram weights vary between sets but are approx. 492 grams piston weight (.030) and 160 grams pin weight. Available in .030 or .060 sizes.', '', '639');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('556', '1', 'G-Force Pro Force Air Helmet', 'SA2005 rated. G-FORCE Racing Gear has teamed with Fresh Air Systems Technologies Inc to create the best airflow helmet on the market today. Compared to the competition, this helmet blows all others away. Pair the Pro Force AIR helmet with a powerful cooled air system to change the way you can endure those heated events.The interior airflow is completely tunable by using the chin bar plugs for restricted or full open airflow. The Pro Force AIR helmet comes standard with the G-Flow ventilation system for the evacuation of heated air to provide an even more intense cooling effect. The eye port is shielded by an optically correct ProFit shield. The inner liner is made from our hypoallergenic CoolTec flame-retardant material for wearer comfort.The Kevlar chin strap fastens the helmet down with added durability. All full-face G-FORCE Racing Gear helmets come equipped with integral mounting points for the G-FORCE Racing Gear SRS-1 Helmet Restraint System. Available in size Small 6-7/8-7, Medium 7-1/8-7-1/4, Large -7 3/8 -7 1/2, X-Large 7-5/8-7-3/4, XX-large7-7/8-8. (This helmet has been very popular for its reasonable cost. Availability is sometimes limited. Please call ahead for verification of availibity of a particular size.) ( Use Kirkey S1003 tearoffs. )', '', '384');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('557', '1', 'Impact - Super Sport Helmet - Flat Black', 'Impact Racing Flat Black Super Sport helmet. (Super Sport also available in silver, black or white.) Made in the USA. Snell SA2005 rated. From the wide eyeport design to the perfect fit and feel the Super Sport is at home in any race car cockpit. Slotted forehead vents. Chinbar vents allow fresh air intake and helps prevent exhale from fogging shields. Hand laminated composite shell for a lightweight helmet. Tear-off posts and metal shield pivot hardware. Fire resistant Kevlar chin strap with locking dual D-rings. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\".', '', '685');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('558', '1', 'MSD - SBC HEI Street Fire Distributor W/Coil', 'MSD # 8362 Street Fire Chevy V8 HEI distributor. The Street Fire distributor is MSD,s first product to come out from their new value branded ignition line and has a one year warranty. Inside, the ignition module and coil work together to produce a stout spark to light the fuel mixture for great performance. The Street Fire is fit with the same gear that is used on their Pro-Billet models. Adjustable vacuum advance. Welded weight pins and heavy duty construction. All new components, including the coil, spec\'d by MSD engineers.', '', '965');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('559', '1', 'Impact - The Racer - 1 Piece Double Layer Driving / Racing Suit', 'Impact -The Racer - 1 piece double layer black racing suit. (Helmet not included)SFI 3-2A/5 Approved and tag included. Soft and breathable Matte Finish Gabardine Nomex  fire resistant shell lined with cool and comfortable Impact MAX moisture management knit liner. 360 degree floating sleeve for complete mobility and unrestricted arm movement. Lower back gussett and internal elastic waistband prevents suit binding when standing, racing or relaxing. Box quilting. Wide athletic shoulder silhouette aids in movement. Inset pant pocket. Boot cut cuff features an in-boot liner with ribbed cuff and over the boot pant for dual coverage. Ribbed fire resistant wrist and ankle cuffs. Banded collar and adjustable waist belt. Available sizes are (small - chest 35-37, waist 26-28, inseam 31, sleeve 33) (medium - chest 37-41, waist 28-32, inseam 32, sleeve 34) (large - chest 41-44, waist 32-36, inseam 33, sleeve 35) (X Large - chest 45-49, waist 36-40, inseam 33, sleeve 35) ( XX Large - chest 49-53, waist 40-44, inseam 33, sleeve 35)', '', '517');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('560', '1', 'Impact - The Racer - 2 Piece Double Layer Driving / Racing Suit', 'Impact -The Racer - 2 piece double layer black racing suit. (Helmet not included)SFI 3-2A/5 Approved and tag included. Soft and breathable Matte Finish Gabardine Nomex fire resistant shell lined with cool and comfortable Impact MAX moisture management knit liner. 360 degree floating sleeve for complete mobility and unrestricted arm movement. Box quilting. Wide athletic shoulder silhouette aids in movement. Inset pant pocket. Boot cut cuff features an in-boot liner with ribbed cuff and over the boot pant for dual coverage. Ribbed fire resistant wrist and ankle cuffs. Jacket and pants sizes can be mixed, Available sizes are (small - chest 35-37, waist 26-28, inseam 31, sleeve 33) (medium - chest 37-41, waist 28-32, inseam 32, sleeve 34) (large - chest 41-44, waist 32-36, inseam 33, sleeve 35) (X Large - chest 45-49, waist 36-40, inseam 33, sleeve 35) ( XX Large - chest 49-53, waist 40-44, inseam 33, sleeve 35)', '', '413');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('561', '1', 'Rebuilt  SB Chevy Heads 52cc 1.84/1.50', 'Pair of casting # 14022601 heads with 1.84 / 1.50 valves. 52cc combustion chamber. Heads were originally on HP 305 engines.  HEADS MUST BE USED WITH FLAT TOP OR DISH TOP PISTONS. These heads are well suited for dirt track or figure 8 racing applications where a higher compression ratio is desired. Compression with a 52cc head on a 350 with flat top pistons is approx. 10.7 to 1. Using a factory dish top piston would be approx. 10 to 1 and may require the use of higher octane fuel. These heads are not recommended for street applications because of the high compression ratios they yield. Heads have bolt holes on the ends for all accesories. These heads are for carbureted engines. Heads are oven baked and shot blasted. Magnafluxed to check for cracks. New cast iron valve guides are installed. Three angle valve job is done on valve seats. Valves are checked for wear and refaced. Heads are given a light surface to ensure flatness. Heads are assembled with new umbrella valve stem seals and new Z28 valve springs (max. .550 lift) and hardened valve locks.These heads have 3/8\" press in studs. All machine work is done in our own shop on quality equipment.', '', '523');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('563', '1', 'Tearoffs - Simpson Voyager', 'Box of 200 clear tearoffs. Straight. Fits Simpson Voyager helmets. 11 3/8\" post centers.', '', '349');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('564', '1', 'Tearoffs - Bell & RCI SA2000 &  RCI SA2005', 'Box of 200 tearoffs. Banana. Fits most all  models of Bell helmets and RCI SA2000 & RCI SA2005 helmets. 12 1/2\" post centers.', '', '382');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('565', '1', 'Tearoffs - Impact SS & Impact Air Draft & Simpson Shark', 'Box of 200 clear tearoffs. Banana. Fits Impact Super Sport helmets, Impact Air Draft & Simpson Shark helmets. 12 3/4\" post centers.', '', '468');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('566', '1', 'Tearoffs - Impact Charger, Vapor, Draft', 'Box of 200 clear tearoffs. Banana. Fits Impact Charger helmets, Impact Vapor helmets or Impact Draft helmets. 12\" post centers.', '', '429');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('567', '1', 'Tearoffs - Impact Champ', 'Box of 200 clear tearoffs. Nose notch. Fits Impact Champ helmets. 11 1/2\" post centers.', '', '412');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('568', '1', 'G-Force GF750 Open Face Helmet', 'G-Force GF750 open face helmet - White. Snell SA2005 and SFI 31.1A certified. Adjustable visor with tinted visor strip. The shell is lightweight to help reduce neck strain for the short runs or daylong events. The fiberglass shell reduces driver fatigue by offering lightweight performance while maintaining the classic style. CoolTec liner is fire resistant, hypoallergenic and comfortable on the skin. Kevlar chin strap for added reassurance in the event of a fire. Evacuation ducts remove heated air around the top and rear of the drivers head for a great cooling effect. Available in  sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\" or XXL - 7 7/8\"-8\".', '', '513');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('569', '1', 'PBM - Aluminum Roller Rockers - 1.6 - 3/8', 'Set of 16 PBM 1.6 ratio aluminum roller rocker arms and polylocks for 3/8\" stud small block chevy engines. Extruded aluminum, precision clearances with tolerance of .001. Oversize nose roller for superior load distribution. Roller trunion, roller tip. Red anodize finish. Rockers will clear 1.475 Dual springs.', '', '72');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('570', '1', 'PBM - Aluminum Roller Rockers - 1.5 - 3/8', 'Set of 16 PBM 1.5 ratio aluminum roller rocker arms and polylocks for 3/8\" stud small block chevy engines. Extruded aluminum, precision clearances with tolerance of .001. Oversize nose roller for superior load distribution. Roller trunion, roller tip. Red anodize finish. Rockers will clear 1.475 Dual springs.', '', '89');
