insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('573', '1', 'Impact - Super Sport S/SA Helmet - Gloss Black', 'Impact Racing Super Sport S/SA helmet is made in the USA and is Snell SA2005 rated. The Super Sport Air features an air induction design called the Head Dress System. Impacts exclusive solution to fresh air cooling and anti-air contamination for total on-track comfort. The Head Dress system utilizes fortified SpeedChannels to emphasize airflow across the head and super wide vision shield. Accepts all common on-board and self contained air induction system attachments. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Use Kirkey # S1011 tearoffs. )', '', '330');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('574', '1', 'Impact - Super Sport S/SA Helmet - Flat Black', 'Impact Racing Super Sport S/SA helmet is made in the USA and is Snell SA2005 rated. The Super Sport Air features an air induction design called the Head Dress System. Impacts exclusive solution to fresh air cooling and anti-air contamination for total on-track comfort. The Head Dress system utilizes fortified SpeedChannels to emphasize airflow across the head and super wide vision shield. Accepts all common on-board and self contained air induction system attachments. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Use Kirkey # S1011 tearoffs. )', '', '443');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('575', '1', 'Impact - Super Sport S/SA Helmet - Silver', 'Impact Racing Super Sport S/SA helmet is made in the USA and is Snell SA2005 rated. The Super Sport Air features an air induction design called the Head Dress System. Impacts exclusive solution to fresh air cooling and anti-air contamination for total on-track comfort. The Head Dress system utilizes fortified SpeedChannels to emphasize airflow across the head and super wide vision shield. Accepts all common on-board and self contained air induction system attachments. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Use Kirkey # S1011 tearoffs. )', '', '313');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('576', '1', 'Impact - Super Sport S/SA Helmet - White', 'Impact Racing Super Sport S/SA helmet is made in the USA and is Snell SA2005 rated. The Super Sport Air features an air induction design called the Head Dress System. Impacts exclusive solution to fresh air cooling and anti-air contamination for total on-track comfort. The Head Dress system utilizes fortified SpeedChannels to emphasize airflow across the head and super wide vision shield. Accepts all common on-board and self contained air induction system attachments. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Use Kirkey # S1011 tearoffs. )', '', '316');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('577', '1', 'Impact - Super Sport Helmet - White', 'Impact Racing White Super Sport helmet. (Super Sport also available in silver or black and limited availabilty in flat black.) Made in the USA. Snell SA2005 rated. From the wide eyeport design to the perfect fit and feel the Super Sport is at home in any race car cockpit. Slotted forehead vents. Chinbar vents allow fresh air intake and helps prevent exhale from fogging shields. Hand laminated composite shell for a lightweight helmet. Tear-off posts and metal shield pivot hardware. Fire resistant Kevlar chin strap with locking dual D-rings. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\".', '', '438');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('578', '1', 'Impact - Draft Helmet - Silver', 'Impact Racing Draft helmet is made in the USA and is Snell SA2005 certified. The Draft features a high-bypass air induction system that circulates air around the head and face. Adjustable forehead vents are channeled to dual rear exhaust vents. Plus nose/mouth chinbar vents. Shell construction featuring proprietary American space age composites for an ultralight helmet. Ripple Effect boundary layer aerodynamic features incorporated in the shell construction stabilize the helmet in high speed airflow. Extended chin foil captures downward airflow to reduce helmet lift and buffeting. Open cockpit eyeport. Fire resistant Kevlar chinstrap with locking dual D-ring design.  Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". FREE HELMET BAG WITH PURCHASE OF ANY IMPACT HELMET THROUGH OUR WEBSITE', '', '167');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('579', '1', 'Impact - Vapor Helmet - Silver', 'Impact Racing Vapor helmet is made in the USA and is Snell SA2005 certified. The Vapor helmet is the result of extensive 3D computer modeling and design utilizing exotic composite construction to create an aerodynamic , ultra lightweight helmet. Chinbar vents and slider forehead vents. Ripple Effect boundary layer aerodynamic features incorporated in the shell construction stabilize the helmet in high speed airflow. Extended chin foil captures downward airflow to reduce helmet lift and buffeting. Open cockpit eyeport. Fire resistant Kevlar chinstrap with locking dual D-ring design. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". FREE HELMET BAG WITH PURCHASE OF ANY IMPACT HELMET THROUGH OUR WEBSITE', '', '167');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('580', '1', 'Economy SA2005 Helmet - RCI', 'RCI SFI certified SA2005 Helmet. Available in white only. This helmet sells for $259.95 at Summit. Multi laminated fiberglass shell, form fitting fire resistant Nomex liner, Kevlar chin strap, large countoured eyeport, clear .125 lexan shield with thumb tab, fully adjustable detent shield pivot with tearoff posts,  chin and forehead fresh air vents.TO ENSURE AN ACCURATE FIT. Carefully measure around your head, above the ears. Take the measurement in inches, referring to the sizing chart below for your correct helmet / hat size. Helmet must fit properly for optimum performance. Don\'t guess your size. Helmet must be securely and snugly fastened before engaging in any activity. (21 5/8\" - 22\" - small -7), (22 3/8\" - 22 3/4\" - medium - 7 1/4), (23 1/8\" - 23 5/8\" - large - 7 1/2), (23 7/8\" - 24 1/2\" - X-large - 7 3/4), (24 3/4 - 25 1/8\" - XX-large - 7 7/8)  (Use Kirkey # S1003 tearoffs)', '', '516');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('581', '1', 'Impact Racing Adult 360 Neck Collar', 'Impact Racing helmet support. High density compression foam increases in resistance the more it is compressed. This compression cycle helps control head and neck roll. Knit exterior sock adapts to shape of compression foam without bunching or wrinkling. Compression foam thickness can easily be shaved down if needed. One size fits most. Meets SFI. Available in black only.', '', '486');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('582', '1', 'Ultra Shield Youth Driving/Racing Jacket', 'Youth single layer Ultrashield driving jacket.  SFI spec 3.2A/1. Made from the highest quality 100% flame retardent materials available with Nomex cuffs and Nomex lined brass zippers. Shoulder epaulettes. Color matching cuffs. Sporty stripes and trim detail. Available in Black, Red or Blue. Sizes available are Small (8-10), Medium (12-14), Large (16 - 18). WE WILL GLADLY EXCHANGE SIZES IF THE FIT ISNT TO YOUR LIKING ALTHOUGH THE CUSTOMER WILL INCUR THE COST OF SHIPPING.', '', '230');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('588', '1', 'Impact Mirror Shield', 'Impact mirror shield. Includes eccentric tear-off posts. (except mini champ). Choose you Impact helmet model below.', '', '804');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('589', '1', 'SB Chevy 40 Degree Swivel Thermostat Housing', 'Small block chevy swivel thermostat housing. Polished aluminum. For 1 1/2\" hose. 360 degree swivel rotation. 40 degree hose angle. O - ring seal.', '', '706');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('590', '1', 'SB Chevy 90 Degree Swivel Thermostat Housing', 'Small block chevy swivel thermostat housing. Polished aluminum. For 1 1/2\" hose. 360 degree swivel rotation. 90 degree hose angle. O - ring seal.', '', '759');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('591', '1', 'SB Chevy Straight  Thermostat Housing', 'Small block chevy  thermostat housing. Polished aluminum. For 1 1/2\" hose.  Straight up hose angle. O - ring seal.', '', '735');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('592', '1', 'Ultra Shield Adult 2-Piece Double Layer Driving / Racing Suit', 'THIS MODEL STYLE SUIT IS BEING REPLACED BY ALL NOMEX SUITS. PLEASE CALL AHEAD FOR AVAILABILITY OF COLORS AND SIZES OF THIS STYLE. Ultrashield double layer SFI 3.2A/5 driving suit. TPP rating of 23. Suit has 360 expandable NOMEX knit shoulder gussets for unrestricted movement and more airflow. Shoulder epaulettes are double stitched for added strength. Straight leg cuff with NOMEX knit foot stirrups. Side seam pockets and color matching stitching. Your choice of Black, Red or Blue. Size (Small - 38\" - 41\" Chest, 28\" - 30\" waist) ( Medium - 42\" - 44\" Chest, 31\" - 33\" Waist) (Large - 45\" - 49\" Chest, 34\" - 39\" Waist) (X-Large - 50\" - 53\" Chest, 40\" - 44\" Waist) (XX-Large - 54\" - 56\" Chest, 45\" - 49\" Waist) (XXX-Large - 56\" - 57\" Chest, 50\" - 51\" Waist) ( XXL suit costs an addional $10.00, XXXL suit costs an additional $30.00) NOTE: WE WILL GLADLY EXCHANGE SIZES IF THE FIT ISNT TO YOUR LIKING ALTHOUGH THE CUSTOMER WILL INCUR THE COST OF SHIPPING.', '', '629');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('611', '1', '350 Chevy World Products SR Torquer 67cc 2.02/1.60 Cylinder Head', 'New pair of assembled World Products S/R Torquer series Iron heads # 42660. Cylinder heads are for carbureted 1955 - 1986 small block 327, 350, 377, 383 or 400 engines. (377 & 400 applications for street would require steam holes to be drilled. We can drill the steam holes for an additional $30.00 for the pair. ) 67cc combustion chambers. ( These heads are also available in 76cc versions. Straight plug design. High flow 170cc intake runners. Hardened steel exhaust seats compatible with unleaded gasoline. Heads are adequate for engines with a projected horsepower in the 400 HP to 450 HP range. Integral cast valve guides. Universal end pads accept all early and late model accessories. Heads have both the perimeter and centerbolt holes for valve covers. These heads are assembled in our machine shop. Seat concentricy is checked. Assembled with PBM race series 1 piece EV-8 stainless 2.02 intake valves and 1.60 exhaust valves with chrome plated and undercut stems, swirl polished stem and hardened tips.  New .600 max. lift 1.250 stock diameter valve springs with 110 # of seat pressure, new steel retainers, hardened locks, and umbrella valve seals. Screw in rocker arm studs (3/8\") and guide plates are also included. All machine work is done in our own shop on quality equipment.', '', '72');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('593', '1', 'Impact - Mini Champ Youth Helmet - Gloss Black', 'Impact Racing Mini Champ Youth helmet. Made in the USA. Finding and fitting a helmet for your constantly growing 5 to 10 year old racer just got simpler. The Mini Champ youth helmet with Quick-Fit Inserts is designed to grow with your young racer all the way to adult size. The Quick-Fit memory foam sizing pads (included) makes fitting and refitting the Mini Champ fast and easy. A single Mini Champ helmet fits youth sizes small, medium and large. You can even custom shape the inserts for hard to fit or in between sizes. The Mini Champ youth helmets are SFI 24.1 approved (youth helmet standard) for QMA/WKA/NHRA/IKF use.', '', '591');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('594', '1', 'Impact - Mini Champ Youth Helmet - Flat Black', 'Impact Racing Mini Champ Youth helmet. Made in the USA. Finding and fitting a helmet for your constantly growing 5 to 10 year old racer just got simpler. The Mini Champ youth helmet with Quick-Fit Inserts is designed to grow with your young racer all the way to adult size. The Quick-Fit memory foam sizing pads (included) makes fitting and refitting the Mini Champ fast and easy. A single Mini Champ helmet fits youth sizes small, medium and large. You can even custom shape the inserts for hard to fit or in between sizes. The Mini Champ youth helmets are SFI 24.1 approved (youth helmet standard) for QMA/WKA/NHRA/IKF use.', '', '646');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('595', '1', 'Impact - Mini Champ Youth Helmet - White', 'Impact Racing Mini Champ Youth helmet. Made in the USA. Finding and fitting a helmet for your constantly growing 5 to 10 year old racer just got simpler. The Mini Champ youth helmet with Quick-Fit Inserts is designed to grow with your young racer all the way to adult size. The Quick-Fit memory foam sizing pads (included) makes fitting and refitting the Mini Champ fast and easy. A single Mini Champ helmet fits youth sizes small, medium and large. You can even custom shape the inserts for hard to fit or in between sizes. The Mini Champ youth helmets are SFI 24.1 approved (youth helmet standard) for QMA/WKA/NHRA/IKF use.  FREE HELMET BAG WITH PURCHASE OF ANY IMPACT HELMET THROUGH OUR WEBSITE', '', '521');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('596', '1', 'Quick Car 2\" Tire Pressure Gauge - Liquid Filled', 'Quick Car 2\" liquid filled tire pressure gauge, (0-20 PSI gauge reads in 1/2 PSI increments) (0-40 PSI gauge reads in 1 PSI increments) (0-60 PSI gauge reads in 1 PSI increments) Pressure relief valve. Strain relief 14\" hose for durability. High quality shock resistant boot.The QuickCar tire pressure gauge is regarded as the most reliable tire pressure gauge in the industry.', '', '429');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('597', '1', 'Quick Car 2\" Tire Pressure Gauge - Glow In The Dark', 'QuickCar Glow in the Dark 2\" face tire pressure gauge. (0-20 gauge measures in 1/2 psi increments, 0-40 & 0-60 read in 1 psi increments.) Pressure relief valve. Strain relief 14\" hose for durability. High quality shock resistant boot.The QuickCar tire pressure gauge is regarded as the most reliable tire pressure gauge in the industry.', '', '493');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('598', '1', 'Impact - Champ Helmet - White', 'Impact Racing Champ helmet. (Champ helmet is also available in gloss black, flat black or silver.) Made in the USA. Snell SA2005 rated. The Champ features a radical chinbar design that extends coverage over the mouth and nose and acts as a breath deflector. The expanded eyeport is designed to work in every racing cockpit. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Uses Kirkey #S1022 tearoffs and tearoff buttons must be relocated .)', '', '829');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('599', '1', 'Impact - Champ Helmet - Flat Black', 'Impact Racing Champ helmet. (Champ helmet is also available in gloss black, silver or white.) Made in the USA. Snell SA2005 rated. The Champ features a radical chinbar design that extends coverage over the mouth and nose and acts as a breath deflector. The expanded eyeport is designed to work in every racing cockpit. Available in sizes Small - 6 7/8\"-7\", Medium - 7 1/8\"-7 1/4\", Large - 7 3/8\"-7 1/2\", X-Large - 7 5/8\"-7 3/4\". ( Uses Kirkey #S1022 tearoffs and tearoff buttons must be relocated .) FREE HELMET BAG WITH PURCHASE OF ANY IMPACT HELMET THROUGH OUR WEBSITE', '', '1086');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('600', '1', 'SB Chevy CT Valve Covers-Polished Aluminum', 'PRC polished cast aluminum small block chevy valve covers for perimeter style bolt pattern heads. (common heads from late 50,s to 1986) Valve cover breather tubes are baffled and are 1 3/8\" O.D.  Tall style valve covers. Extra material is added in the bolt down area for rigidity. ( Use #CP142-3 non shielded breathers or #CP143-3 for shielded breathers )', '', '535');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('601', '1', 'Valve Cover Breather - No Shield - 1 3/8\"', 'Clamp on breather without shield, fits over 1 3/8\" tube.', '', '749');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('602', '1', 'Valve Cover Breather - Shielded - 1 3/8\"', 'Clamp on breather with shield, fits over 1 3/8\" tube.', '', '797');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('603', '1', 'SB Chevy CT Valve Covers-Champ', 'Pair of new Made in the USA Champ plated steel small block chevy valve covers for perimeter style bolt pattern heads. (common heads from late 50,s to 1986) Valve cover breather tubes are welded to valve covers instead of crimped like most of the lower cost import valve covers . Breather tubes are 1 1/2\" O.D. Baffles are also welded to valve covers underneath the breather tubes.', '', '852');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('604', '1', 'Economy SA2005 Helmet - RCI', 'RCI SFI certified SA2005 Helmet. Available in white only. This helmet sells for $259.95 at Summit. Multi laminated fiberglass shell, form fitting fire resistant Nomex liner, Kevlar chin strap, large countoured eyeport, clear .125 lexan shield with thumb tab, fully adjustable detent shield pivot with tearoff posts,  chin and forehead fresh air vents.TO ENSURE AN ACCURATE FIT. Carefully measure around your head, above the ears. Take the measurement in inches, referring to the sizing chart below for your correct helmet / hat size. Helmet must fit properly for optimum performance. Don\'t guess your size. Helmet must be securely and snugly fastened before engaging in any activity. (21 5/8\" - 22\" - small -7), (22 3/8\" - 22 3/4\" - medium - 7 1/4), (23 1/8\" - 23 5/8\" - large - 7 1/2), (23 7/8\" - 24 1/2\" - X-large - 7 3/4), (24 3/4 - 25 1/8\" - XX-large - 7 7/8)  (Use Kirkey # S1003 tearoffs)', '', '723');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('605', '1', 'G-Force Pro Force 1 Graphix Helmet', 'G-Force Pro Force 1 graphix helmet #5405. Size Small 6-7/8-7, Medium 7-1/8-7-1/4, Large -7 3/8 -7 1/2, X-Large 7-5/8-7-3/4, XX-large7-7/8-8.  SA 2005 certified. Lightweight composite shell, Fire-retardant interior,  G-Flow ventilation, Black only. The Pro - Force 1 Graphix is a new helmet with super sleek styling. A Z38 composite shell keeps this helmet light on your shoulders. Keep cool with the integral G - Flow ventilation system that brings in cool air and vents the hot air out of the top and back of the helmet. A Cool Tec liner helps keep you comfortable.  Helmet includes factory mounting points for the G-FORCE racing gear SRS-1 helmet restraint system. ( Use Kirkey # S1003 tearoffs )', '', '732');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('606', '1', 'UltraShield Adult 2 Pc. Single Layer Driving/Racing Suit - 2008', 'New Style for 2008 Ultra Shield 2 piece single layer driving suit, includes jacket and pants. SFI spec 3.2A/1 . Made from the highest quality 100% flame retardant materials available, with Nomex cuffs and Nomex lined brass zippers. Shoulder epaulettes. Color matching cuffs. Pants have boot cut cuffs with foot stirrups on inside cuff. Jacket and pants sizes can be mixed. Your choice of Black, Blue, or Red. Jacket sizes available are ( Small - 38\"- 41\" chest ) ( Medium - 42\"- 44\" chest ) ( Large - 45\"- 49\" chest ) ( X-Large - 50\"- 53\" chest ) ( XX-Large 54\"- 56\" chest ) ( XXX-Large - 56\"- 57\" chest ). Pants sizes available are ( Small - 28\"- 30\" waist ) ( medium - 31\"- 33\" waist ) ( large - 34\"- 39\" waist ) ( X-Large - 40\"- 44\" waist ) ( XX-Large - 45\"- 49\" waist ) ( XXX-Large - 50\"- 51\" waist ), XX-Large sizes and XXX-Large sizes are an additional $5.00 per piece. WE WILL GLADLY EXCHANGE SIZES IF THE FIT ISNT TO YOUR LIKING ALTHOUGH THE CUSTOMER WILL INCUR THE COST OF SHIPPING.', '', '964');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('607', '1', 'Offset Carburetor Stud - 1/4\"', 'For use with offset air cleaner.  1/4\".', '', '653');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('608', '1', 'Impact - The Wizard Helmet - White - NEW FROM IMPACT', 'Impact Racings new WIZARD helmet - White. (We also carry the WIZARD in Flat Black. Currently the only available colors are white or Flat Black. Made in the USA. SNELL SA2005 & SFI/FIA approved. Featuring a wide eyeport design and a standard American shape for fit and form. The Wizard is your American made solution when your budget is tight but your expectations are not. The Wizard is Impacts new entry level helmet in response to import price points. Available in sizes (Small - 6 7/8\"-7\", 21 5/8\"-22\", 55-56 CM), (Medium - 7 1/8\"-7 1/4\", 22 1/2\" - 22 3/4\", 57-58 CM), (Large - 7 3/8\"-7 1/2\", 23 1/4\"-23 5/8\", 59-60 CM) (X-Large - 7 5/8\"-7 3/4\", 24\"-24 1/2\", 61-62 CM)', '', '523');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('609', '1', 'Impact - The Wizard Helmet - Flat Black - NEW FROM IMPACT', 'Impact Racings new WIZARD helmet - Flat Black. We also carry the WIZARD in white. Currently the only available colors are white or Flat Black.  Made in the USA. SNELL SA2005 & SFI/FIA approved. Featuring a wide eyeport design and a standard American shape for fit and form. The Wizard is your American made solution when your budget is tight but your expectations are not. The Wizard is Impacts new entry level helmet in response to import price points. Available in sizes (Small - 6 7/8\"-7\", 21 5/8\"-22\", 55-56 CM), (Medium - 7 1/8\"-7 1/4\", 22 1/2\" - 22 3/4\", 57-58 CM), (Large - 7 3/8\"-7 1/2\", 23 1/4\"-23 5/8\", 59-60 CM) (X-Large - 7 5/8\"-7 3/4\", 24\"-24 1/2\", 61-62 CM)', '', '606');
insert into products_description (products_id, language_id, products_name, products_description, products_url, products_viewed) values ('612', '1', '350 Chevy World Products SR Torquer 76cc 2.02/1.60 Cylinder Head', 'New pair of assembled World Products S/R Torquer series Iron heads # 42670. Cylinder heads are for carbureted 1955 - 1986 small block 327, 350, 377, 383 or 400 engines. (377 & 400 applications for street would require steam holes to be drilled. We can drill the steam holes for an additional $30.00 for the pair. ) 76cc combustion chambers. ( These heads are also available in 67cc versions. Straight plug design. High flow 170cc intake runners. Hardened steel exhaust seats compatible with unleaded gasoline. Heads are adequate for engines with a projected horsepower in the 400 HP to 450 HP range. Integral cast valve guides. Universal end pads accept all early and late model accessories. Heads have both the perimeter and centerbolt holes for valve covers. These heads are assembled in our machine shop. Seat concentricy is checked. Assembled with PBM race series 1 piece EV-8 stainless 2.02 intake valves and 1.60 exhaust valves with chrome plated and undercut stems, swirl polished stem and hardened tips.  New .600 max. lift 1.250 stock diameter valve springs with 110 # of seat pressure, new steel retainers, hardened locks, and umbrella valve seals. Screw in rocker arm studs (3/8\") and guideplates are also included. All machine work is done in our own shop on quality equipment.', '', '60');
